import React from 'react';
import styled from 'styled-components';
import { ReactComponent as Logo } from '../../../assets/airbnb.svg';
import { Link } from 'react-router-dom';
import { connect } from 'react-redux';
import { mainpage } from '../../../../redux/header/header.action';

const LogoTriggeer = ({ searchButtonHeaderToggle }) => {
  return (
    <div>
      <Link to="/">
        <LogoItself onClick={searchButtonHeaderToggle} />
        <LogoText>airbnb</LogoText>
      </Link>
    </div>
  );
};

const mapDispatchToProps = dispatch => ({
  searchButtonHeaderToggle: () => dispatch(mainpage()),
});

export const LogoContainer = styled(Link)`
  display: flex;
  width: 15%;
  cursor: pointer;
  height: 3em;
`;
export const LogoText = styled(Link)`
  font-size: 32px;
  padding: 0.2em;
`;
export const LogoItself = styled(Logo)`
  cursor: pointer;
  height: 50px;
  width: 20%;
  padding-right: 0px;
`;

export default connect(mapDispatchToProps, null)(LogoTriggeer);
